[[File:David Cracknell.jpg|thumb]]
'''David Cracknell''' is a former journalist in the [[United Kingdom]]. Formerly Political Editor of [[The Sunday Times]], he is head of a public relations firm, Big Tent Communications.

==Early life==

Cracknell attended [[Forest School (Walthamstow)|Forest School]] in London and later went on to [[Pembroke College, Oxford]]. While at Oxford, his short story \Alternative Medicine\" was published by Margaret Drabble in the first series of [[The Mays]].<ref>[https://www.instagram.com/p/BUihhFUDEpn/]</ref>

